import React, { Component } from 'react'

export default class MenuBar extends Component {
    render(){
        return(
            <nav class="side-bar">
                <div class="padding-6">
                    <ul class="menu-bar">
                        <li><a class="active" href="#">Beranda</a></li>
                        <li class="margin-top-6"><a href="#">Informasi Sekolah</a></li>
                        <li class="margin-top-6"><a href="#">Guru & Staff</a></li>
                        <li class="margin-top-6"><a href="#">Santri & Orang Tua</a></li>
                        <li class="margin-top-6"><a href="#">Daftar Pembayaran</a></li>
                        <li class="margin-top-6"><a href="#">Managemen Kartu</a></li>
                    </ul>
                </div>
            </nav>
        )
    }
}
